import decodeBase64ToArrayBuffer from "./base64.js";

const bleep = ``;
const solid = ``;
const powerUp = ``;

const breakout = ``;
const bleep_stuck = ``;


export default class AudioManager {
    private readonly context: AudioContext;
    constructor() {
        this.context = wx.createWebAudioContext();
    }
    playBleep() {
        const source = this.context.createBufferSource();
        this.context.decodeAudioData(decodeBase64ToArrayBuffer(bleep), buffer => {
            source.buffer = buffer;
            source.connect(this.context.destination);
            source.start()
        }, console.error);
    }
    playBleepStuck() {
        const source = this.context.createBufferSource();
        this.context.decodeAudioData(decodeBase64ToArrayBuffer(bleep_stuck), buffer => {
            source.buffer = buffer;
            source.connect(this.context.destination);
            source.start()
        }, console.error);
    }
    playPowerUp() {
        const source = this.context.createBufferSource();
        this.context.decodeAudioData(decodeBase64ToArrayBuffer(powerUp), buffer => {
            source.buffer = buffer;
            source.connect(this.context.destination);
            source.start()
        }, console.error);
    }
    playSolid() {
        const source = this.context.createBufferSource();
        this.context.decodeAudioData(decodeBase64ToArrayBuffer(solid), buffer => {
            source.buffer = buffer;
            source.connect(this.context.destination);
            source.start()
        }, console.error);
    }
    playBreakout() {
        const source = this.context.createBufferSource();
        this.context.decodeAudioData(decodeBase64ToArrayBuffer(breakout), buffer => {
            source.buffer = buffer;
            source.loop = true;
            source.connect(this.context.destination);
            source.start()
        }, console.error);
    }
}